import React from 'react'

const NavBar = () => {
  return (
    <>
    
      <nav className='navbar navbar-dark navbar-expand-sm bg-dark'>
        <div className="container bg-">
            <link className='nav-brand'><i className='fa fa-mobile text-warning'>Conatact <span className='text-warning'>Manager</span></i></link>
        </div>

      </nav>
    </>
  )
}

export default NavBar
